import React, { useState } from "react";
// import { Form, Card, Button } from "react-bootstrap";
import validator from "validator";
import { Modal, Form, Col, Row, Container, FormGroup,Button } from "react-bootstrap";
// import validator from "validator";
import Card from "react-bootstrap/Card";
// creating functional component ans getting props from app.js and destucturing them
const StepTwo = ({ nextStep, handleFormData, prevStep, values }) => {
   //creating error state for validation
  const [error, setError] = useState(false);

    // after form submit validating the form data using validator
  const submitFormData = (e) => {
    e.preventDefault();

     // checking if value of first name and last name is empty show error else take to next step
    if (validator.isEmpty(values.phone) || validator.isEmpty(values.email)) {
      setError(true);
    } else {
      nextStep();
    }
  };
  return (
    <>
      <Card style={{ marginTop: 100 }}>
        <Card.Body>
          <Form onSubmit={submitFormData}>
          <Row>
              <h5
                className="py-2 "
                style={{ fontSize: "22px", padding: "0px 19px" }}
              >
                Primary
              </h5>
              <Col xxl="6" xl="6" lg="6" md="6">
                <Form.Group
                  as={Col}
                  controlId="formGridphone"
                  className="formmargin "
                >
                  <Form.Label>Phone</Form.Label>
                  <Form.Control
                    type="number"
                    required
                    name="primaryphone"
                    placeholder="phone"
                    defaultValue={values.phone}
                    // value={emp.primaryphone}
                    // value={props.value8}
                    // onChange={handleinput}
                    // onChange={props.onChange}
                    onChange={handleFormData("phone")}
                  />
                </Form.Group>
              </Col>
              <Col xxl="6" xl="6" lg="6" md="6">
                <Form.Group
                  as={Col}
                  controlId="formGridcompanyemail"
                  className="formmargin "
                >
                  <Form.Label>Email</Form.Label>
                  <Form.Control
                    type="email"
                    required
                    name="primaryemail"
                    placeholder="email"
                    // value={emp.primaryemail}
                    defaultValue={values.email}
                    // value={props.value9}
                    // onChange={handleinput}
                    // onChange={props.onChange}
                    onChange={handleFormData("email")}
                  />
                </Form.Group>
              </Col>
            </Row>

            <Row>
               <h5
                className="py-2 "
                style={{ fontSize: "22px", padding: "0px 19px" }}
              >
                Secondary
              </h5>
              <Col xxl="6" xl="6" lg="6" md="6">
                <Form.Group
                  as={Col}
                  controlId="formGridcompanyemail"
                  className="formmargin "
                >
                  <Form.Label>Phone</Form.Label>
                  <Form.Control
                    type="number"
                    required
                    name="secondaryphone"
                    placeholder="secondary phone"
                    // value={emp.secondaryphone}
                    // value={props.value10}
                    // onChange={handleinput}
                    defaultValue={values.phone}
                    // onChange={props.onChange}
                    onChange={handleFormData("phone")}
                  />
                </Form.Group>
              </Col>
              <Col xxl="6" xl="6" lg="6" md="6">
                <Form.Group
                  as={Col}
                  controlId="formGridcompanyemail"
                  className="formmargin "
                >
                  <Form.Label>Email</Form.Label>
                  <Form.Control
                    type="email"
                    required
                    name="secondaryemail"
                    placeholder="secondary Email"
                    // value={emp.secondaryemail}
                    defaultValue={values.email}
                    // value={props.value11}
                    // onChange={handleinput}
                    // onChange={props.onChange}
                    onChange={handleFormData("email")}
                  />
                </Form.Group>
              </Col>
            </Row>
            <div style={{ display: "flex" }}>
              <Button variant="primary" onClick={prevStep}>
                Previous
              </Button>

              <Button variant="primary" type="submit">
                Next
              </Button>
            </div>
          </Form>
        </Card.Body>
      </Card>
    </>
  );
};

export default StepTwo;
